import React from "react";
import { Icon } from "../Icon/Icon";
import {
  Item,
  List,
  TopWrapper,
  NameWrapper,
  RatingWrapper,
  Avatar,
  Name,
  Text,
} from './Reviews.styled'

export const Reviews = ({ reviews }) => {
  return (
    <List>
      {reviews.map((review) => {
        console.log(review);
        return (
          <Item>
            <TopWrapper>
              <Avatar></Avatar>
              <NameWrapper>
                <Name></Name>
                <RatingWrapper>
                  <Icon />
                </RatingWrapper>
              </NameWrapper>
            </TopWrapper>
            <Text></Text>
          </Item>
        );
      })}
    </List>
  );
};
